import React from "react";
import styled from "styled-components";
import Spacer from "../../../components/Spacer";
import Card from "../../../components/Card";
import CardButton from "../../../components/CardButton";
const Item: React.FC = ({}) => {
  return (
    <>
      <Card className="wing-blank-lg width-47">
        <Spacer size="mmd" />
        <div className="flex-row-center-center">
          <img
            src={require("../../../assets/img/USDT_icon.png")}
            width="40"
            height="40"
            className="margin-left-minus-10"
          />
          <img
            src={require("../../../assets/img/PUSDT_icon.png")}
            width="40"
            height="40"
            className="margin-left-minus-10"
          />
        </div>
        <Spacer size="sm" />
        <div className="font-size-16 text-center">ETH - PETH</div>
        <Spacer size="ssm" />
        <div className="color-grey  text-center">存 LP-ETH 赚 ASET</div>
        <Spacer size="mmd" />
        <CardButton className="flex-jc-center  wing-blank-lg">
          <div className="color-grey">TVL</div>
          <div className="color-grey">$ 1,234.45</div>
        </CardButton>
        <Spacer size="sm" />
        <CardButton className="flex-jc-center  wing-blank-lg">
          <div className="color-grey">TVL</div>
          <div className="color-grey">$ 1,234.45</div>
        </CardButton>
        <Spacer size="sm" />
        <CardButton className="flex-jc-center  wing-blank-lg">
          <div className="color-grey">TVL</div>
          <div className="color-grey">$ 1,234.45</div>
        </CardButton>
        <Spacer size="sm" />
        <CardButton className="flex-jc-center  wing-blank-lg">
          <div className="color-grey">TVL</div>
          <div className="color-grey">$ 1,234.45</div>
        </CardButton>
        <Spacer size="sm" />
      </Card>
      <Spacer size="sm" />
      <Spacer size="sm" />
    </>
  );
};
const List: React.FC = ({ text }) => {
  return (
    <>
      <div className="flex-jc-center">
        <Item />
        <Item />
      </div>
      <Spacer size="sm" />
      <Spacer size="sm" />
    </>
  );
};

export default List;
